import React from 'react';
import { Link } from 'react-router-dom';

export default function NavBar() {
  return (
    <ul>
      <li><Link to="/">Back to Book Search</Link></li>
      <li><Link to="/saved">Saved Books</Link></li>
    </ul>
  );
}
